CREATE TABLE bin_data(
   iin_start     INTEGER  NOT NULL PRIMARY KEY 
  ,iin_end       INTEGER 
  ,number_length INTEGER 
  ,number_luhn   VARCHAR(30)
  ,scheme        VARCHAR(10) NOT NULL
  ,brand         VARCHAR(25)
  ,type          VARCHAR(6) NOT NULL
  ,prepaid       VARCHAR(1)
  ,country       VARCHAR(2) NOT NULL
  ,bank_name     VARCHAR(53)
  ,bank_logo     VARCHAR(30)
  ,bank_url      VARCHAR(30)
  ,bank_phone    VARCHAR(25)
  ,bank_city     VARCHAR(19)
);
